import gmpy2
import libnum
from Crypto.Util.number import *
import uuid
flag = 'flag{'+str(uuid.uuid4())+"}"
print(flag)
flag1=flag[:21]
flag2=flag[21:]
m1=libnum.s2n(flag1)
m2=libnum.s2n(flag2)

p = getPrime(1024)
q= getPrime(1024)
n=p*q
phi=(p-1)*(q-1)
e1 =  getPrime(16)
e2 =  getPrime(16)
d1 =libnum.invmod(e1,phi)
d2 =libnum.invmod(e2,phi)
dd=d2-d1

c1=pow(m1,e1,n)
c2=pow(m2,e2,n)
print("c1=",c1)
print("c2=",c2)
print("n=",n)
print("e1=",e1)
print("e2=",e2)
print("dd=",dd)
